import React from 'react'; 
import { NavLink } from 'react-router-dom';

const Nav = () => {
    return(
        <nav className="main-nav">
             <ul>
                <li><NavLink to="/leaves">Leaves</NavLink></li>
                <li><NavLink to="/forest">Forest</NavLink></li>
                <li><NavLink to="/sunset">Sunset</NavLink></li>
            </ul>
        </nav>
    );
};

export default Nav;
